backends:
- group: taskqueue-v1beta2
  url_pattern: /taskqueue/v1beta2/projects/{project}/taskqueues/{taskqueue}
  method: GET
  host:
  - https://www.googleapis.com
  whitelist:
  - acl
  - id
  - kind
  - maxLeases
  - stats
  concurrent_calls: 1
  mapping:
    acl: acl
    id: id
    kind: kind
    maxLeases: maxLeases
    stats: stats
  extra_config:
    slug: taskqueue-v1beta2-taskqueue-v1beta2-projects-project-taskqueues-taskqueue
    hosts:
    - https://www.googleapis.com
    schemes:
    - https
- group: taskqueue-v1beta2
